  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains monthly data for the
  current fiscal year for each WIC State agency.  There are currently 90 WIC State
  agencies:  the 50 geographic states, the District of Columbia, Puerto Rico, Guam,
  the Virgin Islands, American Samoa, Northern Marianas, and 34 Indian tribal organizations
  (ITO's). The dataset contains number of  Pregnant Women, Breastfeeding Women, Postpartum
  Women, Total Women,  Infants and children participating in the WIC program and the
